// src/pages/Home.js
import React from 'react';

function Home() {
  return (
    <div style={{ padding: '20px' }}>
      <h1>VS Code 스타일 블로그</h1>
      <p>글 목록(추후 구현 예정)</p>
    </div>
  );
}

export default Home;
